#!/usr/bin/python
import sys
import re
from string import ascii_lowercase

INPUT = ""

INPUT2 = "dabAcCaCBAcCcaDA"
types = ['a', 'b', 'c', 'd', 'e', 'f', 'g', 'h', 'i', 'j', 'k', 'l', 'm', 'n', 'o', 'p', 'q', 'r', 's', 't',]
regex = re.compile(".*?(aA|Aa|bB|Bb|cC|Cc|dD|Dd|eE|Ee|fF|Ff|gG|Gg|hH|Hh|iI|Ii|jJ|Jj|kK|Kk|lL|Ll|mM|Mm|nN|Nn|oO|Oo|pP|Pp|qQ|Qq|rR|Rr|sS|Ss|tT|Tt|uU|Uu|vV|Vv|wW|Ww|xX|Xx|yY|Yy|zZ|Zz).*")

smallest = sys.maxsize
for letter in ascii_lowercase:
	capitalLetter = chr(ord(letter)-32)
	REMOVED = re.sub("[" + letter + capitalLetter + "]", "", INPUT)
	match = re.match(regex, REMOVED)
	while match:
		#print match.group(1)
		REMOVED = re.sub(match.group(1), "", REMOVED, count=1)
		match = re.match(regex, REMOVED)
	if len(REMOVED) < smallest:
		smallest = len(REMOVED)
print(smallest)
